и управленцем. В истине, лидерство является ценным искусством, и следовательно, истинным лидером считается только тот, кто способен слушать, понимать собеседника(ов) без каких-либо возмущении или упреков, и умеет подбирать нужные слова поддержки и давать мудрые советы, когда это необходимо. Сегодня мы познакомим вас с настоящим лидером нашего времени, с Василенко Романом Викторовичем! \r\n \r\nСкорее всего, в современном мире, в нашем обществе не осталось человека, который не слышал бы это имя. Василенко Роман родился в городе Ленинград (настоящее название города – Санкт-Петербург) пятого апреля одна тысяча девятьсот шестьдесят девятого года. Его родители были военными людьми, что повлияло на его решение поступить в Ярославское Высшее Военное Финансовое училище. Он успешно закончил это учебное заведение в одна тысяча девятьсот девяностом году, получил звание офицера и специальность «Экономиста». После окончания училища до 1998 года Роман Викторович прослужил на флоте, в ВМФ. В дополнение к вышесказанному, он в течение 16 лет, 1996-2012, посетил многие развитые страны, в число которых входят Америка, Франция, Австрия, Венгрия, Кипр, Швейцария и Маврикия, с целью пройти курсы и углубить знания в МВА. \r\n \r\nВ настоящее время Роман Викторович больше известен в качестве общественного деятеля, филантропа, бизнесмена и мецената. Также, он – \r\n \r\nпредседатель правления жилищного кооператива «Бест Вей» с августа 2014 года и основатель и идейный вдохновитель на международном уровне известного, крупного холдинга «Life is Good» с 2014 года. Стоит заметить, что именно Василенко Роман дал второе рождение жилищной кооперации, тщательно продумав структуру работы ЖК «Бест Вей». Находясь во главе названных организаций, он помогает миллионам людям воплощать в реальность свои самые заветные мечты, приобретать свое собственное долгожданное жилье. Есть много живых примеров того, как люди получают квартиру, благодаря сотрудничеству с ЖК «Бест Вей» и своим регулярным паевым взносам. Его деятельность видна и высоко оценивается, доказательством этому можно описать заслуженно полученные им награды. Например, в его копилке имеются такие звания, как «Финансист 2015» (2015 г), «Национально Значимое Предприятие» (2015), «Элита Национальной Экономики» (2015), и т.д. Но и на этом наш лидер не остановился, он получил академическую степень, защитив свою кандидатскую работу в 2015 году', 'Настоящий лидер нашего времени – Василенко Роман Викторович! \r\n<a href=https://dzen.ru/a/XzLLTaCvozeXxneG>Роман Василенко уголовное дело </a> \r\nБытует мнение о том, что лидерами никак не рождаются, а становятся. Согласитесь, это ведь на самом деле так?! Несмотря на ваши этнические корни, место рождения и/или проживания, материальный достаток, образ жизни, статус в обществе, занимаемую должность на работе, и т.п., всем даются одинаковые возможности, и, по большому счету, все люди рождаются равными. В основном, у большого количества человечества имеется одинаковый ресурс: наши руки, ноги, голова… Но, как бы странно это не было, у всех своя судьба складывается совершенно разным образом: некоторым так и не удается достигнуть чего-то действительно стоящего в жизни, в то время как другие вырастают в средне статистическое население в обществе, и лишь у считанного количества людей получается стать настоящими лидерами. \r\n \r\nНу, кого можно считать настоящим лидером? В просторах интернета дается очень большое количество определений этому слову. В основном, они имеют следующий смысловой окрас: лидер - это тот человек, который может исполнять роль правильной модели для своих сверстников, который обладает определенными личностными качествами, и который может быть главой и/или управленцем. В истине, лидерство является ценным искусством, и следовательно, истинным лидером считается только тот, кто способен слушать, понимать собеседника(ов) без каких-либо возмущении или упреков, и умеет подбирать нужные слова поддержки и давать мудрые советы, когда это необходимо. Сегодня мы позна