ива \\\"Бест Вей\\\" из разных городов России подают заявления председателю Следственного комитета России Александру Бастрыкину на следователей ГСУ ГУ МВД России по Санкт-Петербургу и Ленинградской области, ведущую уголовное дело, связываемое ей с кооперативом. \r\nНа момент публикации заявления от пайщиков из Москвы, Санкт-Петербурга, Новосибирска, Казани, Красноярска, Ставрополя, Челябинска, Оренбурга, Ижевска, Чебоксар, Саратова, Белгорода, Хабаровска, Улан-Удэ, Барнаула, Абакана, города Чайковский Пермского края готовятся новые. \r\nЗаявления — с подписными листами, в каждом — десятки подписавшихся пайщиков, например, московский подписной лист подписало 80 пайщиков, сообщили нам активисты кооператива. \r\nПричина подачи заявлений, как пояснили нам активисты кооператива — блокирование следствием собственных средств пайщиков кооператива уже более года и отказ следственной группе в выплате даже на основе судебных решений.', 'User', 'User', '2024-03-24 06:27:37')
